import React, { Component } from 'react';

const d3 = window.d3;

export default class D3Test extends Component{

    componentDidMount(){

        let width = 800, height = 800;

        const mapColor = '#114a93';
        const mapLineColor = '#0d67c7';

        let svg = d3.select('.container')
            .append('svg')
            .attr('width', width + 'px')
            .attr('height', height + 'px')

        let projection = d3.geoMercator()
            .center([107, 31])
            .scale(850)

        let path = d3.geoPath()
            .projection(projection);
        let mapLayer = svg.append('g')
            .attr('class', 'maplayer')
        fetch('geojson/CHN.json').then((response) => {
            console.log("34523434", response.json().features);
            mapLayer.selectAll('path').data(response.json().features)
        })
    }

    render(){
        return(
            <div className='container' style={{width: 800, height: 800, background: '#fff'}}>

            </div>
        )
    }
}
